.nav-menu {
  display: flex;
  list-style: none;
  margin: 0;
  padding: 0;
  align-items: center;
  justify-content: space-around;
}

/* .nav-menu li {
  flex: 1;
  cursor: pointer;
  display: flex;
  align-items: center;
  height: 100%;
} */

.nav-menu a {
  text-decoration: none;
}

.dropdown {
  display: inline-block;
  position: relative;
}

.dropdown .dropdown-menu {
  border: none;
  -webkit-box-shadow: 0 8px 16px 5px rgba(0, 0, 0, 0.1);
  box-shadow: 0 8px 16px 5px rgba(0, 0, 0, 0.1);
}

.dropdown-menu {
  position: absolute;
  top: 100%;
  left: 0;
  z-index: 1000;
  display: none;
  float: left;
  min-width: 10rem;
  padding: 0.5rem 0;
  margin: 0.125rem 0 0;
  font-size: 1rem;
  color: #607179;
  text-align: left;
  list-style: none;
  background-color: #fff;
  background-clip: padding-box;
  border: 1px solid rgba(0, 0, 0, 0.15);
  border-radius: 0.3125rem;
}

.nav-menu .nav-menu-item.dropdown:hover > .dropdown-menu {
  display: block;
}

.nav-menu .dropdown-menu {
  margin: 0;
  padding: 0;
  display: none;
  list-style: none;
}

.nav-menu-mobile {
  display: flex;
  align-items: center;
}

.nav-menu-mobile i {
  font-size: 24px;
  cursor: pointer;
}

#nav-menu-popup {
  position: fixed;
  display: none;
  width: 100%;
  height: 100%;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  z-index: 100;
  opacity: 0;
  transition: opacity 0.3s ease;
  background: var(--overlay);
}

#nav-menu-popup.show {
  opacity: 1;
}
#nav-menu-popup .nav-menu-body {
  position: absolute;
  background-color: white;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  padding: 45px;
  overflow: auto;
}

#nav-menu-popup .nav-menu-body .close-menu {
  cursor: pointer;
  position: absolute;
  top: 20px;
  left: 20px;
  z-index: 100;
}

#nav-menu-popup .nav-menu-body .close-menu::before {
  content: '\f00d';
}

#nav-menu-popup .nav-menu {
  display: flex;
  flex-direction: column;
  list-style: none;
  padding: 0;
  margin: 0;
  align-items: center;
}

#nav-menu-popup .nav-menu .nav-menu-item {
  user-select: none;
  width: 100%;
  text-align: left;
  list-style: none;
}

#nav-menu-popup .nav-menu .nav-menu-item .nav-menu-item-content {
  display: flex;
  position: relative;
}

#nav-menu-popup .nav-menu-item .nav-menu-item-title {
  margin: 0 1rem;
  max-width: calc(100% - 2rem);
  flex-grow: 1;
}

#nav-menu-popup
  .nav-menu
  .nav-menu-item
  .nav-menu-item-content
  .nav-menu-item-toggle {
  position: absolute;
  top: calc(50% - 12px);
  right: 0;
  font-size: 24px;
  cursor: pointer;
}

#nav-menu-popup
  .nav-menu
  .nav-menu-item
  .nav-menu-item-content
  .nav-menu-item-toggle
  i {
  font-size: 24px;
  transition: transform 0.2s ease;
}

#nav-menu-popup
  .nav-menu
  .nav-menu-item
  .nav-menu-item-content
  .nav-menu-item-toggle
  i::before {
  content: '\f107';
}

#nav-menu-popup
  .nav-menu
  .nav-menu-item.active
  .nav-menu-item-content
  .nav-menu-item-toggle
  i {
  transform: rotate(-180deg);
}

#nav-menu-popup .nav-menu .nav-menu-item .nav-dropdown-menu {
  padding: 0;
  display: none;
  opacity: 0;
  max-height: 0;
  overflow: auto;
  visibility: hidden;
  transition: all 0.3s ease-in-out;
}

#nav-menu-popup .nav-menu .nav-menu-item.active .nav-dropdown-menu {
  display: block;
  opacity: 1;
  max-height: 600px;
  visibility: visible;
}

